        ///</summary>
        public Image? image { get; set; }
        ///<summary>
        ///The line item group associated to the line item.
        ///</summary>
        public LineItemGroup? lineItemGroup { get; set; }
        ///<summary>
        ///Whether the line item can be edited or not.
        ///</summary>
        public bool? merchantEditable { get; set; }
